import React, { useState, useEffect } from 'react';
import './Dashboard.css';

const ReceptionistDashboard = () => {
  const [stats, setStats] = useState({
    patientsRegistered: 0,
    totalAppointments: 0,
    pendingQueue: 0
  });

  const [todayQueue, setTodayQueue] = useState([]);
  const [billingSummary, setBillingSummary] = useState([]);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const response = await fetch('/api/receptionist/dashboard-summary');
      const data = await response.json();
      setStats(data.stats);
      setTodayQueue(data.todayQueue || []);
      setBillingSummary(data.billingSummary || []);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      // Fallback data
      setStats({
        patientsRegistered: 25,
        totalAppointments: 48,
        pendingQueue: 6
      });
      setTodayQueue([
        { department: 'Eye', patient: 'Eye', status: 'active' },
        { department: 'ENT', patient: 'ENT', status: 'active' },
        { department: 'Skin', patient: 'Skin', status: 'active' }
      ]);
      setBillingSummary([
        { patient: 'Anaka Toma', department: 'Eye', amount: 1400, status: 'Pending' },
        { patient: 'Joseph Mwang', department: 'ENT', amount: 1000, status: 'Pending' },
        { patient: 'Ranon Hi', department: 'Skin', amount: 1000, status: 'Pending' }
      ]);
    }
  };

  return (
    <div className="receptionist-dashboard">
      <div className="dashboard-header">
        <div className="header-icon">👤</div>
        <div className="header-content">
          <h1>Receptionist</h1>
          <p>Welcome back, Name! Here's what's happening</p>
        </div>
      </div>

      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon orange">👥</div>
          <div className="stat-content">
            <div className="stat-value">{stats.patientsRegistered}</div>
            <div className="stat-label">Patients Registered</div>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon orange">📅</div>
          <div className="stat-content">
            <div className="stat-value">{stats.totalAppointments}</div>
            <div className="stat-label">Total Appointments</div>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon orange">👥</div>
          <div className="stat-content">
            <div className="stat-value">{stats.pendingQueue}</div>
            <div className="stat-label">Pending Queue</div>
          </div>
        </div>
      </div>

      <div className="queue-section">
        <div className="queue-card">
          <h3>Today's Queue</h3>
          <div className="queue-header">
            <span>Sectorne</span>
            <span>Patient</span>
            <span>Statevert</span>
          </div>
          {todayQueue.map((item, index) => (
            <div key={index} className="queue-row">
              <span className="queue-department">{item.department}</span>
              <span className="queue-patient">{item.patient}</span>
              <div className="queue-status">
                <div className="status-bar orange"></div>
              </div>
            </div>
          ))}
        </div>
      </div>

      <div className="billing-section">
        <div className="billing-card">
          <h3>Billing Summary</h3>
          <div className="billing-header">
            <span>Patient Name</span>
            <span>Department</span>
            <span>Amount</span>
            <span>Status</span>
          </div>
          {billingSummary.map((bill, index) => (
            <div key={index} className="billing-row">
              <span className="patient-name">{bill.patient}</span>
              <span className="department-name">{bill.department}</span>
              <span className="amount">${bill.amount.toLocaleString()}</span>
              <span className="status-badge">{bill.status}</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ReceptionistDashboard;
